	@Keyword
	public void cumulativeNormalCsv () {
		selenium = getSelenium()
		String tiret = '-'
		if (((GlobalVariable.env != 'dev') && (GlobalVariable.env != 'staging')) && (GlobalVariable.env != 'prod')) {
			GlobalVariable.env2 = 'saas'
		} else if (GlobalVariable.env == 'prod') {
			tiret = ''
			GlobalVariable.env = ''
		}

		// Create folder
		WebUI.waitForElementVisible(findTestObject('Object Repository/2. Folders list/Open first folder button'), 5)
		createFolder("Test auto - Cumulative - CSV Settings - Normal CSV")
		// Cumulative iterations - CSV < 20 rows
		KeywordUtil.logInfo("Cumulative iterations - CSV < 20 rows")
		String page = "folders"

		goToCommander()
		WebUI.waitForPageLoad(30)
		WebUI.waitForElementPresent(selectorToTestObject("body > p > a > button"), 30)
		WebUI.click(selectorToTestObject("body > p > a > button"))
		selenium.waitForPageToLoad("30000")
		String currentTime = selenium.getValue("css=#delta_interval")
		if(currentTime != "P0D") {
			WebUI.clearText(selectorToTestObject("#delta_interval"))
			Thread.sleep(1000)
			WebUI.sendKeys(selectorToTestObject("#delta_interval"), "P0D")
			WebUI.waitForElementPresent(selectorToTestObject("form > p > input[type=\"submit\"]"), 30)
			WebUI.click(selectorToTestObject("form > p > input[type=\"submit\"]"))
			selenium.waitForPageToLoad("30000")
