		WebUI.click(selectorToTestObject("app-new-document-dialog > form > mat-dialog-actions > button.mat-raised-button.mat-accent > span"))
		WebUI.waitForElementVisible(selectorToTestObject("app-document > section > subreport > div > header > span"), 30)
